import React, { useState } from 'react';
import axios from 'axios';
import Header from '../components/header'; 
import Footer from '../components/footer';

const NewOrderForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    type: 'regular load',
    kilo: '',
    service: 'Washing',
    description: '',
    status: 'pending',
    price: 0 // Initialize price with 0
  });

  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [type, setType] = useState('regular load');
  const [kilo, setKilo] = useState('');
  const [service, setService] = useState('Washing');
  const [description, setDescription] = useState('');

  // Function to calculate price based on kilos and type
  const calculatePrice = () => {
    let basePrice = 0;
    let excessPricePerKilo = 0;

    if (type === 'regular load') {
      basePrice = 250;
      if (kilo > 8) {
        excessPricePerKilo = 32;
      }
    } else if (type === 'heavy load') {
      basePrice = 280;
      if (kilo > 5) {
        excessPricePerKilo = 56;
      }
    }

    let price = basePrice + (excessPricePerKilo * (kilo - 8)); // Adjust kilo based on criteria
    if (service === 'Washing' && kilo <= 8) {
      price = 125;
    } else if (service === 'Drying' && kilo <= 8) {
      price = 125;
    } else if (service === 'Washing' && kilo <= 5 && type === 'heavy load') {
      price = 140;
    } else if (service === 'Drying' && kilo <= 5 && type === 'heavy load') {
      price = 140;
    }

    setFormData({ ...formData, price }); // Update price in form data
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      await axios.post("http://localhost:3000/order/postorder", {
        firstName,
        lastName,
        type,
        kilo,
        service,
        description,
        status: 'pending',
        price,
        createdAt: new Date()
      });
      alert("Order submitted successfully! ");
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div>
      <Header />
      <div className="container">
        <br />
        <h1 className="mb-4">New Order Form</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="firstName">First Name:</label>
            <input type="text" id="firstName" value={firstName} onChange={(event) => setFirstName(event.target.value)} />
          </div>

          <div className="form-group">
            <label htmlFor="lastName">Last Name:</label>
            <input type="text" id="lastName" value={lastName} onChange={(event) => setLastName(event.target.value)} />
          </div>

          <div className="form-group">
            <label htmlFor="type">Item Type:</label>
            <select className="form-control" id="type" name="type" value={type} onChange={(event) => setType(event.target.value)}>
              <option value="regular load">Regular Load</option>
              <option value="heavy load">Heavy Load</option>
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="kilo">Kilos:</label>
            <input type="number" className="form-control" id="kilo" name="kilo" value={kilo} onChange={(event) => setKilo(event.target.value)} />
          </div>

          <div className="form-group">
            <label htmlFor="service">Service:</label>
            <select className="form-control" id="service" name="service" value={service} onChange={(event) => setService(event.target.value)}>
              <option value="Washing">Washing</option>
              <option value="Drying">Drying</option>
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="description">Description:</label>
            <textarea className="form-control" id="description" name="description" value={description} onChange={(event) => setDescription(event.target.value)}></textarea>
          </div>

          <button type="submit" className="btn btn-primary">Submit</button>
        </form>
      </div>
      <Footer />
    </div>
  );
};

export default NewOrderForm;
